import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';
import TabLink from './TabLink';
import Home from './Home';
import About from './About';
import Contact from './Contact';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import Card from './components/Card';
import './styles.css'; // Asegúrate de que tus estilos estén importados


function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          {/* Logo en la parte izquierda */}
          <div className="logo">MyLogo</div>

          {/* Menú de navegación en la parte derecha */}
          <nav>
            <ul className="tabs">
              <TabLink to="/" path="/">Home</TabLink>
              <TabLink to="/about" path="/about">About</TabLink>
              <TabLink to="/contact" path="/contact">Contact</TabLink>
            </ul>
          </nav>
        </header>
        <div className="content">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/about" element={<About />} />
            <Route path="/contact" element={<Contact />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

ReactDOM.render(<Card />, document.querySelector('.react-card'));


export default App;
